import Button from "./button";

function Sidebar() {
  return (
    <aside className="grid grid-aside">
      <section>
        <Button kind="primary" text="Github" />
        <Button kind="primary" text="Linkedin" />
        <Button kind="primary" text="Twitter" />
        <Button kind="secondary" text="Button 4" />
        <Button kind="secondary" text="Button 5" />
        <Button kind="secondary" text="Button 6" />
      </section>
    </aside>
  );
}

export default Sidebar;
